<!DOCTYPE html>
<html lang="ru">
<head>
    <meta charset="UTF-8">
    <meta name="viewport" content="width=device-width, initial-scale=1.0">
    <title>Самолет-стрелялка</title>
    <style>
        body {
            margin: 0;
            overflow: hidden;
            font-family: Arial, sans-serif;
        }
        #game {
            position: relative;
            width: 100vw;
            height: 100vh;
            background-color: black; /* Фон по умолчанию */
        }
        #player, .enemy, .bullet {
            position: absolute;
        }
        #player {
            width: 80px; /* Увеличенный размер для мобильных устройств */
            height: 80px;
        }
        .enemy {
            width: 60px; /* Увеличенный размер для мобильных устройств */
            height: 60px;
        }
        .bullet {
            width: 8px; /* Увеличенный размер для мобильных устройств */
            height: 20px;
            background-color: yellow;
        }
        #score {
            position: absolute;
            top: 10px;
            left: 10px;
            color: white;
            font-size: 24px;
            background-color: rgba(0, 0, 0, 0.5);
            padding: 5px 10px;
            border-radius: 5px;
        }

        /* Кнопки управления */
        #controls {
            position: absolute;
            bottom: 20px;
            left: 50%;
            transform: translateX(-50%);
            display: flex;
            gap: 20px;
        }
        .control-button {
            width: 60px;
            height: 60px;
            background-color: rgba(255, 255, 255, 0.5);
            border: 2px solid white;
            border-radius: 100%;
            display: flex;
            justify-content: center;
            align-items: center;
            font-size: 24px;
            color: white;
            user-select: none;
        }

        /* Адаптация для мобильных устройств */
        @media (max-width: 600px) {
            #player {
                width: 60px;
                height: 60px;
            }
            .enemy {
                width: 40px;
                height: 40px;
            }
            .bullet {
                width: 5px;
                height: 15px;
            }
            #score {
                font-size: 18px;
            }
            .control-button {
                width: 50px;
                height: 50px;
                font-size: 20px;
            }
        }
    </style>
</head>
<body>
    <div id="game">
        <div id="score">Токены: <span id="tokens">0</span></div>
        <div id="controls">
            <div id="left-button" class="control-button">←</div>
            <div id="right-button" class="control-button">→</div>
        </div>
    </div>

        const player = document.createElement('img');
        player.id = 'player';
        player.src = playerImage;
        player.style.left = '50%';
        player.style.bottom = '10px';
        player.style.transform = 'translateX(-50%)';
        game.appendChild(player);

        // Положение игрока
        let playerX = 50;

        // Флаги для отслеживания нажатия клавиш
        let moveLeft = false;
        let moveRight = false;

        // Обработка касаний для кнопок
        leftButton.addEventListener('touchstart', () => moveLeft = true);
        leftButton.addEventListener('touchend', () => moveLeft = false);
        rightButton.addEventListener('touchstart', () => moveRight = true);
        rightButton.addEventListener('touchend', () => moveRight = false);

        // Обработка нажатия клавиш (для ПК)
        document.addEventListener('keydown', (e) => {
            if (e.key === 'ArrowLeft') {
                moveLeft = true;
            }
            if (e.key === 'ArrowRight') {
                moveRight = true;
            }
        });

        // Обработка отпускания клавиш (для ПК)
        document.addEventListener('keyup', (e) => {
            if (e.key === 'ArrowLeft') {
                moveLeft = false;
            }
            if (e.key === 'ArrowRight') {
                moveRight = false;
            }
        });

        // Основной игровой цикл
        function gameLoop() {
            if (moveLeft && playerX > 0) {
                playerX -= 0.35; // Скорость движения влево
            }
            if (moveRight && playerX < 100) {
                playerX += 0.35; // Скорость движения вправо
            }
            player.style.left = `calc(${playerX}% - 25px)`; // Центрирование игрока
            requestAnimationFrame(gameLoop); // Продолжаем цикл
        }

        // Запуск игрового цикла
        gameLoop();

        // Создание врагов
        function createEnemy() {
            const enemy = document.createElement('img');
            enemy.classList.add('enemy');
            enemy.src = enemyImage;
            enemy.style.left = `${Math.random() * 90}%`; // Случайное положение по X
            game.appendChild(enemy);

            let enemyY = 0;
            const enemyInterval = setInterval(() => {
                enemyY += 2; // Скорость врага
                enemy.style.top = `${enemyY}px`;

                // Проверка столкновения с игроком
                if (enemyY + enemy.offsetHeight >= window.innerHeight - player.offsetHeight && 
                    parseInt(enemy.style.left) >= playerX - player.offsetWidth / 2 && 
                    parseInt(enemy.style.left) <= playerX + player.offsetWidth / 2) {
                    clearInterval(enemyInterval);
                    game.removeChild(enemy);
                    alert('Игра окончена!');
                    location.reload();
                }

                // Удаление врага, если он ушел за экран
                if (enemyY > window.innerHeight) {
                    clearInterval(enemyInterval);
                    game.removeChild(enemy);
                }
            }, 20);
        }

        // Создание пули
        function shoot() {
            const bullet = document.createElement('div');
            bullet.classList.add('bullet');
            bullet.style.left = `calc(${playerX}% - 2.5px)`; // Центрирование пули
            bullet.style.bottom = '60px';
            game.appendChild(bullet);

            let bulletY = 60;
            const bulletInterval = setInterval(() => {
                bulletY += 5; // Скорость пули
                bullet.style.bottom = `${bulletY}px`;

                // Проверка столкновения пули с врагами
                const enemies = document.querySelectorAll('.enemy');
                enemies.forEach(enemy => {
                    const enemyRect = enemy.getBoundingClientRect();
                    const bulletRect = bullet.getBoundingClientRect();

                    // Улучшенная проверка столкновения
                    if (bulletRect.bottom >= enemyRect.top &&
                        bulletRect.top <= enemyRect.bottom &&
                        bulletRect.left >= enemyRect.left - 10 && // Учитываем ширину пули
                        bulletRect.right <= enemyRect.right + 10) { // Учитываем ширину пули
                        clearInterval(bulletInterval);
                        game.removeChild(bullet);
                        game.removeChild(enemy);
                        tokens += 1; // Начисление токенов
                        tokensElement.textContent = tokens;
                    }
                });

                // Удаление пули, если она ушла за экран
                if (bulletY > window.innerHeight) {
                    clearInterval(bulletInterval);
                    game.removeChild(bullet);
                }
            }, 10); // Уменьшен интервал для более точной проверки столкновений
        }

        // Стрельба по нажатию пробела (для ПК)
        document.addEventListener('keydown', (e) => {
            if (e.key === ' ') {
                shoot();
            }
        });

        // Стрельба по касанию (для мобильных устройств)
        game.addEventListener('touchstart', () => shoot());

        // Создание врагов каждые 2 секунды
        setInterval(createEnemy, 2000);
    </script>
</body>
</html>
